import React, { Component } from "react";
import Router from "next/router";
import { BASE_URL } from "../config";
import axios from "axios";
import MainMenu from "../Components/Header/MainMenu";
import { Card, Image, Button, Header } from "semantic-ui-react";
const router = Router;
console.log(router);

export default class confirmed extends Component {
  static async getInitialProps() {
    let confirms = [];
    try {
      const response = await axios.get(`${BASE_URL}/confirmed`);
      confirms = response.data;
      console.table(confirms);
    } catch (error) {
      console.log(error);
    }
    return { confirms };
  }
  componentDidMount() {
    console.log("Yay");
  }

  renderConfirmed(confirms) {
    return confirms.map((key) => {
      //  console.log(confirms);
      return confirms;
    });
  }
  render() {
    const { confirms } = this.props;
    return (
      <div className="main">
        <MainMenu router={router} />
        {confirms.map((key, i) => {
          <Header as="h1">{key.provinceState}</Header>;
        })}
        <Card.Group className="card-main">
          <Card className="center">
            <Card.Content>
              <Image
                floated="right"
                size="mini"
                src="https://react.semantic-ui.com/images/avatar/large/steve.jpg"
                className="center"
              />
              <Card.Description className="lowerSpace">
                Province state:
                <strong>best friends</strong>
              </Card.Description>
              <Card.Description className="lowerSpace">
                Country Region:
                <strong>best friends</strong>
              </Card.Description>
              <Card.Description className="lowerSpace">
                Last Update:
                <strong>best friends</strong>
              </Card.Description>
              <Card.Description className="lowerSpace">
                Confirmed:
                <strong>best friends</strong>
              </Card.Description>
              <Card.Description className="lowerSpace">
                Active:
                <strong>best friends</strong>
              </Card.Description>
            </Card.Content>
            <Card.Content extra>
              <div className="ui two buttons">
                <Button basic color="red">
                  Incident Rate: 8.34%
                </Button>
              </div>
            </Card.Content>
          </Card>
        </Card.Group>
      </div>
    );
  }
}
